from typing import List, Dict
from collections import defaultdict
from helpers2 import Color as C

class Solution:
    # https://leetcode.com/problems/number-of-matching-subsequences/discuss/329381/Python-Solution-With-Detailed-Explanation
    # also related: https://leetcode.com/problems/number-of-matching-subsequences/discuss/1290406/C%2B%2BJavaPython-Next-Letter-Pointers-Picture-explain-O(N-%2B-S)
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        bucket = defaultdict(list)

        for word in words:
            bucket[word[0]].append(word)

        # print("initial", bucket)

        count = 0
        for letter in s:
            # print(letter, [(word, len(word)) for word in bucket[letter]])
            nextWords = bucket[letter]
            bucket[letter] = []
            for word in nextWords:
                if len(word) == 1:
                    count += 1
                else:
                    bucket[word[1]].append(word[1:])
        return count

    # this is len(words) * len(s), we have to look at each word even if we know it doesn't match. Not great for a big input
    def numMatchingSubseqSlow(self, s: str, words: List[str]) -> int:
        indices = [0 for _ in range(len(words))]

        for letter in s:
            for i in range(len(words)):
                if indices[i] < len(words[i]) and letter == words[i][indices[i]]:
                    indices[i] += 1

        count = 0
        for i in range(len(words)):
            count += int(len(words[i]) == indices[i])
        return count

    def numMatchingSubseqTrieTooManyCalls(self, s: str, words: List[str]) -> int:
        t = Trie()
        for word in words:
            t.insert(word)

        count = 0
        seen = set()
        def helper(s: str, i: int, trie) -> None:
            nonlocal count
            print("helper", i, f"{s[:i]}{C.RED}{s[i]}{C.RESET}{s[i+1:]}", "count", count)
            if trie.end and trie.word not in seen:
                count += trie.count
                seen.add(trie.word)
                # print("match", s[:i], trie.word, count)

            while i < len(s):
                letter = s[i]
                if letter in trie.children:
                    helper(s, i + 1, trie.children[letter])
                i += 1

        helper(s, 0, t)
        return count

class Trie:
    def __init__(self):
        self.children: Dict[str, Trie] = dict()
        self.count = 0
        self.end = False
        self.letter = "*"
        self.word = ""

    def __repr__(self):
        return f"{self.letter}"

    def insert(self, s):
        if not s:
            return

        curr: Trie = self
        for letter in s:
            if letter not in curr.children:
                curr.children[letter] = Trie()
            curr = curr.children[letter]
            curr.letter = letter

        curr.count += 1
        curr.end = True
        curr.word = s

